import React from 'react';
import logo from './path_to_logo.png'; // Replace with the path to your logo
import bgImage from './path_to_bg_image.png'; // Replace with the path to the Karnataka coffee fields image

function Banner() {
  return (
    <div className="banner" style={{ backgroundImage: `url(${bgImage})` }}>
      <img src={logo} alt="Avery Time Logo" />
    </div>
  );
}

export default Banner;
